import React from 'react';

const Circle = () => {
  return <View style={styles.circle} />;
};

StyleSheet.create({
  circle: {
    width: 100,
    height: 100,
    borderRadius: 100 / 2,
    backgroundColor: "red",
  },
});


export class Square extends React.Component {
  render() {
    const w = 100;
    const h = 100;
    const cursor = this.props.contents == " " ? 'crosshair':'not-allowed';
    const style = {
      width: w,
      height:h,
      backgroundColor:this.props.color,
      color:'white',
      border:"2px solid black",
      tableLayout:'fixed',
      cursor: cursor
    }

    return (
      <td
        style={style}
        onClick={this.props.onClick}
        >
          <Circle />
          {this.props.contents}
      </td>
    )
  }
}
